<html><head>
		<meta http-equiv="Content-Type" content="text/html; charset=utf-8">
		<style>
			body {
	background: #f3f3f3;
	
	
	
}

[contenteditable=true]:empty:before {
	content: attr(data-placeholder);
	display: block; /* For Firefox */
}

li[contenteditable=true]:hover, li[contenteditable=true].hovered {
	border: 1px solid #ff0000;
}

span:hover, span.hovered {
	box-shadow: inset 0 0 0 1px #ff0000;
}

li[contenteditable=true]{
	border: 1px dashed #000;
	width: 100%;
	padding: 2px;
	margin: 0 0 5px 0;
}

ul {
	list-style-type:none;
}

nav {
	background: #444;
	position: fixed;
	top: 0;
	left: 0;
	height: 100%;
	width: 10%;
	font-family: "Helvetica Neue", Arial, sans-serif;
}

nav ul {
	list-style: none;
	margin-right: 1em;
}

nav li {
	display : inline-block;
}

nav a {
	color: white;
	text-decoration: none;
}

nav a:hover {
	text-decoration: underline;	
}

.container {
	position: relative;
	margin-left: 15%;
	display: table;
	height: 100%;
	width: 85%;
}

.column {
	display: table-cell;
	vertical-align: top;
	width: 50%;
	padding: 1rem;
}

.page_image {
	width: 100%;
}

#download_button {
	position: fixed;
	padding: 0;
	text-align: center;
	width: 10%;
	bottom: 50px;
}

.corrected {
	background-color: #73AD21;
}

		</script>
		<script>
			$(document).ready(function() {
				// resize image map based on scaled
				$('map').imageMapResize();
				$('img[usemap]').maphilight({"fill": false});

				// focus text fields when lines/words are clicked + mouseover
				$('area').click(function(e) {
					$('#' + $(this).attr('alt')).focus();
				}).mouseover(function(e) {
					$('#' + $(this).attr('alt')).toggleClass("hovered");;
				}).mouseout(function(e) {
					$('#' + $(this).attr('alt')).toggleClass("hovered");;
				});
				// create mouseover effect on text fields
				$('li[contenteditable=true], span').mouseover(function(e) {
					$('area[alt=' + this.id + ']').mouseover();
				}).mouseout(function(e) {
					$('area[alt=' + this.id + ']').mouseout();
				}).focusin(function(e) {
					$('area[alt=' + this.id + ']').data('maphilight', {'alwaysOn': true}).trigger('alwaysOn.maphilight');
				}).focusout(function(e) {
					$('area[alt=' + this.id + ']').data('maphilight', {'alwaysOn': false}).trigger('alwaysOn.maphilight');
				}).keydown(function(e) {
					if(e.which == 13) {
						e.preventDefault();
						$(this).addClass('corrected');
						var $els = $('[contenteditable=true]');
						$els.eq($els.index(this) + 1).focus();
					}
				});

				$('#download_button').on('click', function(event) {
					path = window.location.pathname;
					$(this).attr('href', 'data:text/html,' + encodeURIComponent($('html')[0].outerHTML));
					$(this).attr('download', path.substr(path.lastIndexOf('/') + 1));
				});
			});
		</script>
